    function getTicket(uint32 k) public view returns (uint256[6] memory) {
        uint256[6] memory result;
        uint32 i = 0;
        for (uint32 j = 0; j < players.length; j++) {
            if (players[j].addr == msg.sender) {
                if (i == k) {
                    result = players[j].ticket;
                    break;
                } else i++;
            }
        }
        return (result);
    }

